import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import MyPage from './routes/Mypage';
import SignUp from './routes/Signup';
import Home from './routes/Home';
import Login from './routes/Login';

function App() {
  return (
    <Router>
        <div className="flex flex-col items-center mt-10">
          <div className="mb-4">
            <Link to="/" className="px-4 py-2 bg-blue-500 text-white rounded-md">홈</Link>
          </div>
          <div className="mb-4">
            <Link to="/mypage" className="px-4 py-2 bg-blue-500 text-white rounded-md">마이페이지</Link>
          </div>
          <div className="mb-4">
            <Link to="/login" className="px-4 py-2 bg-blue-500 text-white rounded-md">로그인</Link>
          </div>
          <div>
            <Link to="/signup" className="px-4 py-2 bg-blue-500 text-white rounded-md">회원가입</Link>
          </div>
        </div>


      <Routes>
        {/* 라우터 화면 즉 옮길 위치 */}
        <Route path="/" element={<Home />} />
        <Route path="/mypage" element={<MyPage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<SignUp />} />
      </Routes>
    </Router>
  );
}

export default App;
